function injectPoddy() {
  const poddyImage = document.createElement("img");
  poddyImage.src =
    "data:image/png;base64,"; // Replace with base64 data URL for poddy.png
  poddyImage.id = "poddy";
  document.body.appendChild(poddyImage);
  addBlinkingEffect(poddyImage);
}

function addBlinkingEffect(poddyImage) {
  const normalImage =
    "data:image/png;base64,"; // Replace with base64 data URL for poddy.png
  const blinkingImage =
    "data:image/png;base64,"; // Replace with base64 data URL for poddy-blink.png

  function blink() {
    if (poddyImage.src === normalImage) {
      poddyImage.src = blinkingImage;
    } else {
      poddyImage.src = normalImage;
    }
  }

  function getRandomBlinkInterval() {
    // Get a random interval between 5 and 15 seconds
    return (Math.random() * 10 + 5) * 1000;
  }

  function scheduleNextBlink() {
    setTimeout(() => {
      blink();
      scheduleNextBlink();
    }, getRandomBlinkInterval());
  }

  scheduleNextBlink();
}

window.addEventListener("load", () => {
  injectPoddy();
});
